import React from 'react';
import LoadingComponent from 'Components/ComponentLoading';
import Loadable from 'react-loadable';


// 定义
const DataPage = Loadable({
  loader: () => import('layouts/StatisticsManage/DataPage'),
  loading: LoadingComponent
});
// 库存
const PerformancePage = Loadable({
  loader: () => import('layouts/StatisticsManage/PerformancePage'),
  loading: LoadingComponent
});
// 详情
const DevicePage = Loadable({
  loader: () => import('layouts/StatisticsManage/DevicePage'),
  loading: LoadingComponent
});

export {
  DataPage, PerformancePage, DevicePage
};
